import React from "react"
import axios from "axios"

const baseUrl = "https://passgen-server.herokuapp.com/"
axios.defaults.we
class App extends React.Component {
    constructor(props) {
        super(props)

        axios.get(baseUrl).then((res) => {
            console.log(res)
        })

        this.state = {
            users: []
        }
    }

    render() {
        return (<div>
            <p>{this.props.res}</p>
        </div>)
    }
}

export default App
